import React from "react";

function Form() {
    return (
        <div className="card">
            <div className="card-body">
                <p><strong>Book Search</strong></p>
                <br/>
                <p>Book</p>
                <br/>
                <input className="form-control" id="bookSearch" placeholder="Harry Potter"/>
            </div>
        </div>
    )
}

export default Form;
